import React from 'react';
import {HomeRoundedIcon, ClassRoundedIcon, CalendarTodayRoundedIcon, ListRoundedIcon, TimerRoundedIcon} from '@material-ui/icons';

const NavBarItems =[
    {
        title: "Home",
        icon: <HomeRoundedIcon/>
    },
    {
        title: "Units",
        icon: <ClassRoundedIcon/>
    },
    {
        title: "Calendar",
        icon: <CalendarTodayRoundedIcon/>
    },
    {
        title: "Reminder",
        icon: <ListRoundedIcon/>
    },
    {
        title: "Study Timer",
        icon: <TimerRoundedIcon/>
    },

]
export default NavBarItems
